import React from 'react'


const ChildComponent = (x) => {
  return (
    <div>
        <h1>Quiz Programming</h1>
        <p>What programming for build cross-platform app?</p>
        <button onClick={()=>x.onQuiz('react')}>React</button>
        <button onClick={()=>x.onQuiz('python')}>Python</button>
        <button onClick={()=>x.onQuiz('golang')}>Golang</button>
        <h2>{x.yourAnswer}</h2>
    </div>
  )
}
export default ChildComponent;
